div.div:
resolveCollisions():
for each CollisionEvent:
// hit top = (0, -y)
// hit bottom = (0, y)
// hit left = (-x, 0)
// hit right = (x, 0)
-> if (collisionVector.y != 0) {
invert y velocity
shift origin by (velocity.x, collisionVector.y)
} else if (collisionVector.x != 0) {
invert x velocity
shift origin by (collisionVector.x, velocity.y)
}
